import '../stylesheets/main.css';
import { flexBox } from './bootstrap/classnames';


function Main() {
  return (
    <section className={flexBox}>
      <ul className='box'>
        <li id='first-box'>Visual Identity Design</li>
        <li className='box'>Visual Identity Design</li>
        <li>Visual Identity Design</li>
        <li>Visual Identity Design</li>
        <li>Visual Identity Design</li> 
      </ul>
    </section>
  )
}

export default Main;
